def construct_permutation(n, q):
    """"""
    se = set()
    se.add(q[0])
    ans = [q[0]]
    l = 1
    for i in range(1, n):
        if q[i] == q[i - 1]:
            while l in se:
                l += 1
            ans.append(l)
            se.add(l)
        else:
            ans.append(q[i])
            se.add(q[i])
        if ans[i] > q[i]:
            return -1
    if len(set(ans)) == n:
        return ans
    else:
        return -1
